import './style.css';

export default function AccountFooter() {
  return (
    <>
    <ul className="account-footer">
      <li><a className="account-footer-items" href="#" target="_blank">Privacy</a></li>
      <li><a className="account-footer-items" href="#" target="_blank">Terms</a></li>
      <li><a className="account-footer-items" href="#" target="_blank">Help</a></li>
      <li><a className="account-footer-items" href="#" target="_blank">About</a></li>
    </ul>
    </>
  )
}
